import Carousel from 'react-bootstrap/Carousel'
const ImgCarousel = (props) =>{

    var sneaker = props.sneaker;

 console.log(props.imageClass)

    const images = () =>{


        if(sneaker.imageLinks && sneaker.imageLinks.length > 0){

        return (
            sneaker.imageLinks.map(image=>(
            <Carousel.Item>
                <img class={props.imageClass} src={image}></img>
            </Carousel.Item>
        )));}
        else{

            console.log(props);
            return(
                <Carousel.Item>
                <img class='carousel-img' src={props.image}></img>
                </Carousel.Item>

            )
        }






    }



    return(
        <Carousel>

            {images()}



        </Carousel>
    );

}

export default ImgCarousel
